import React from "react";
import { RecoilRoot } from "recoil";
import styled from "styled-components";
import Router from "./Router";
import { GlobalStyle } from "./styles/Globalstyles";

const Container = styled.div`
  width: 1440px;
  height: 900px;
`;

function App() {
  return (
    <RecoilRoot>
      <GlobalStyle />
      <Router />
    </RecoilRoot>
  );
}

export default App;
